  input: TEXT,SA11A1,SA11A1.49159,"On 11/2/05 we received a contribution from Kent
    Downey in the amount of $5,000 which was deposited into our federal account.  Two
    hundred and fifty dollars was transferred to our non-federal account on 11/2/05,
    which can accept unlimited contributions from individuals.  A letter was sent
    to Mr. Downey to advise him of how his deposit was split into our accounts and
    to offer him a chance for a refund.  According to AO 2001-17, the Commission has
    deemed it sufficient to deposit checks exceeding the federal limits into the federal
    account and then to make a transfer to the non-federal account for the portion
    that exceeds the federal limit.  Therefore, year to date aggregate totals reported
    by Kent Downey on our report is a reflection of the federal portion of the donor's
    contributions to date."
