  input: TEXT,SA11A1,SA11A1.49160,"On 11/2/05 we received a contribution from Dave
    Richter in the amount of $5,000 which was deposited into our federal account.  Two
    hundred and fifty dollars will be transferred to our non-federal account on 12/20/05,
    which can accept unlimited contributions from individuals.  A letter will be sent
