  input: TEXT,SA11A1,SA11A1.49169,"On 11/3/05 we received a contribution from Lewis
    Smoot in the amount of $25,000, which was deposited into our federal account.  Ten
    thousand was reattributed to his spouse, Genevieve Smoot and five thousand was
    transferred to our non-federal account on 11/3/05 which can accept unlimited contributions
    from individuals.  A letter was sent to Mr. & Mrs. Smoot to advise them of how
    their contribution was split into our accounts and to offer them a chance for
    a refund.  According to AO 2001-17, the Commission has deemed it sufficient to
    deposit checks exceeding the federal limits into a federal account and then to
    make a transfer to the non-federal account for the portion that exceeds the federal
    limit.  Therefore, year to date aggregate totals reported by Lewis Smoot on our
    report is a reflection of the federal portion of the donor's contribution to date."
